import React from 'react';
import Navbar from './components/Navbar';
import DegreeCard from './components/DegreeCard';
import ContestsCard from './components/ContestsCard';
import SearchJobs from './components/SearchJobs';
import AIResumeBuilder from './components/AIResumeBuilder';
import XclusivesCard from './components/XclusivesCard';
import BlogCard from './components/BlogCard';
import ViewProfile from './components/ViewProfile';

function App() {
  return (
    <div className="min-h-screen bg-gray-50 w-full">
      {/* Header */}
      <header className="w-full bg-white shadow-sm fixed top-0 left-0 z-50">
        <div className="max-w-[1300px] mx-auto">
          <Navbar />
        </div>
      </header>

      {/* Main Content */}
      <div className="w-full max-w-[1300px] mx-auto px-10 py-8 mt-[60px]">
        <main>
          {/* Top Section - Three Cards */}
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {/* Degree Card */}
            <div className="flex justify-center">
              <div className="w-[350px] h-[380px]">
                <DegreeCard />
              </div>
            </div>

            {/* Contests Card */}
            <div className="flex justify-center">
              <div className="w-[400px] h-[200px]">
                <ContestsCard />
              </div>
            </div>

            {/* AI Resume Builder with Profile Card */}
            <div className="relative flex justify-center">
              <div className="w-[320px] h-[300px]">
                <AIResumeBuilder />
              </div>
              {/* Profile Card - Positioned Absolutely */}
              <div className="absolute top-0 right-0 w-[150px]">
                <ViewProfile />
              </div>
            </div>
          </div>

          {/* Search Jobs - Centered */}
          <div className="flex justify-center mt-10">
            <div className="w-[500px]">
              <SearchJobs />
            </div>
          </div>

          {/* Bottom Row */}
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6 mt-10">
            {/* Xclusives Card */}
            <div className="flex justify-center">
              <div className="w-[320px] h-[200px]">
                <XclusivesCard />
              </div>
            </div>

            {/* Blog Card */}
            <div className="flex justify-center">
              <div className="w-[400px] h-[200px]">
                <BlogCard />
              </div>
            </div>
          </div>
        </main>
      </div>
    </div>
  );
}

export default App;
